@zerowondering Depression or not, if you have a healthy routine, it won't be a problem anymore. Regular 3 meals a day, 1 hour exercise, and 8 hours of work.

Easier said than done, right?
You can also go to therapy or your family doctor for recommendations. I can also help. Just DM me.

@sbeezer Can you get checked out by a dr? Have you been in or started menopause? Hormone imbalances can cause depression. So can a lack of vitaminD.
Highly recommend a dr. visit if you can. 
If not, try some multi vites and a menopause supplement. I had good luck with amberen.
